css:
@-moz-document
regexp("(https|http)://(www|en|de|es|pt|ko).wikipedia\\.(org|([a-z]{2})).*"),
url-prefix(https://www.wikipedia)
{
BODY{background-color:#222; color:#fff;}

A{color:#0BB;}

A:visited{color:#088;}
A.mw-wiki-logo{background-color:000;}
DIV#mw-head,DIV#mw-content-text,DIV#content.mw-body,DIV#mw-normal-catlinks,DIV.thumbcaption{background-color:#222; color:#fff;}
DIV#mw-panel{background-color:#000; color:#f0f}

TABLE,TABLE.navbox,TD,UL{background-color:#222; color:#fff;}
TR,TH.navbox-title,TH.navbox-grpup{background-color:#022;}
H1,SPAN.mw-headline{color:#fff;}
DIV.interlanguage-link{background-color:000;}
}
